pragma solidity 0.8.25;




contract MitoStakeERC20 is ERC20, Ownable2Step, ReentrancyGuard {
    uint256 private constant _MAX_SUPPLY = 5e26; // 500M MTO

    // =======================
    // Staking Variables
    // =======================
    struct Stake {
        uint256 amount;
        uint256 startTime;
        uint256 unlockTime;
        uint256 reward;
        bool unstaked;
    }

    mapping(address => Stake[]) public stakes;
    uint256 public totalStaked;
    bool public stakingEnabled;

    // **Slot tracking**
    mapping(uint256 => uint256) public stakedCounts;
    mapping(uint256 => uint256) public maxSlots;

    // **Reward rates**
    mapping(uint256 => uint256) public rewardRates;

    event Staked(
        address indexed user,
        uint256 amount,
        uint256 unlockTime,
        uint256 reward
    );
    event Unstaked(address indexed user, uint256 amount, uint256 reward);
    event RewardRatesUpdated(uint256[] newRates);
    event StakingToggled(bool enable);
    event MaxSlotsUpdated(uint256[] maxSlots);

    // =======================
    // Multi-Signature Minting Variables
    // =======================
    address public approval; // Approval address

    // Only the approval can call functions with this modifier.
    modifier onlyApproval() {
        require(msg.sender == approval, "Not approval");
        _;
    }

    struct MintProposal {
        address recipient;
        uint256 amount;
        bool ownerApproved; // Automatically set when owner creates the proposal
        bool approvalApproved;
        bool executed;
    }

    uint256 public proposalCount;
    mapping(uint256 => MintProposal) public mintProposals;

    event MintProposalCreated(
        uint256 indexed proposalId,
        address indexed recipient,
        uint256 amount
    );
    event MintProposalConfirmed(uint256 indexed proposalId, address indexed confirmer);
    event MintExecuted(uint256 indexed proposalId, address indexed recipient, uint256 amount);

    // =======================
    // Constructor
    // =======================
    constructor(address _approval)
        payable
        ERC20("Mito", "MITO")
        Ownable(msg.sender)
    {
        require(_approval != address(0), "Invalid approval");
        approval = _approval;
        address contractAddress = address(this);
        _mint(contractAddress, _MAX_SUPPLY);

        // Initialize staking parameters: max slots per lock period
        maxSlots[45] = 100;
        maxSlots[90] = 100;
        maxSlots[180] = 100;
        maxSlots[270] = 80;
        maxSlots[365] = 80;

        // Initialize reward rates (expressed in basis points; e.g., 86 means 0.86%)
        rewardRates[45] = 86; // 0.86%
        rewardRates[90] = 345; // 3.45%
        rewardRates[180] = 1415; // 14.15%
        rewardRates[270] = 2663; // 26.63%
        rewardRates[365] = 3000; // 30%
    }

    // =======================
    // Multi-Signature Minting Functions
    // =======================

    // Owner creates a mint proposal. This automatically approves the proposal from the owner's side.
    function proposeMint(address recipient, uint256 amount)
        external
        payable
        onlyOwner
    {
        address vaultAddress = address(this);
        require(balanceOf(vaultAddress) > amount, "Vault empty");

        mintProposals[proposalCount].recipient = recipient;
        mintProposals[proposalCount].amount = amount;
        mintProposals[proposalCount].ownerApproved = true;
        mintProposals[proposalCount].approvalApproved = false;
        mintProposals[proposalCount].executed = false;

        emit MintProposalCreated(proposalCount, recipient, amount);
        unchecked {
            proposalCount++;
        }
    }

    // Approval confirms a mint proposal.
    function confirmMint(uint256 proposalId) external onlyApproval {
        MintProposal storage proposal = mintProposals[proposalId];
        require(!proposal.executed, "Proposal already executed");
        require(proposal.ownerApproved, "Proposal not approved by owner");

        proposal.approvalApproved = true;
        emit MintProposalConfirmed(proposalId, msg.sender);
    }

    // Execute the mint if both the owner and approval have approved.
    function executeMint(uint256 proposalId) external nonReentrant onlyOwner {
        MintProposal storage proposal = mintProposals[proposalId];
        require(!proposal.executed, "Proposal already executed");
        require(proposal.ownerApproved, "Owner not approved");
        require(proposal.approvalApproved, "Approval not approved");
        address contractAddress = address(this);
        require(
            balanceOf(contractAddress) > proposal.amount - 1,
            "Vault empty"
        );

        proposal.executed = true;
        _transfer(address(this), proposal.recipient, proposal.amount);
        emit MintExecuted(proposalId, proposal.recipient, proposal.amount);
    }

    event ApprovalUpdated(
        address indexed previousApproval,
        address indexed newApproval
    );

    // Update the approval address.
    function updateApproval(address newApproval) external payable onlyOwner {
        require(newApproval != address(0), "Invalid approval address");
        emit ApprovalUpdated(approval, newApproval);
        approval = newApproval;
    }

    // =======================
    // Staking Functions
    // =======================

    // Toggle staking functionality on or off.
    function toggleStaking(bool _status) external payable onlyOwner {
        stakingEnabled = _status;
        emit StakingToggled(_status);
    }

    // Update max slots for given lock periods.
    function updateMaxSlots(
        uint256[] calldata periods,
        uint256[] calldata newLimits
    ) external payable onlyOwner {
        require(periods.length == newLimits.length, "Invalid input lengths");
        uint256 periodsLength = periods.length;
        for (uint256 i = 0; i < periodsLength; ) {
            maxSlots[periods[i]] = newLimits[i];
            unchecked {
                i++;
            }
        }
        emit MaxSlotsUpdated(newLimits);
    }

    // Update reward rates for given lock periods.
    function updateRewardRates(
        uint256[] calldata periods,
        uint256[] calldata newRates
    ) external payable onlyOwner {
        uint256 length = periods.length;
        for (uint256 i = 0; i < length; ) {
            rewardRates[periods[i]] = newRates[i];
            unchecked {
                i++;
            }
        }

        emit RewardRatesUpdated(newRates);
    }

    // Stake tokens with a specified lock period.
    function stake(uint256 amount, uint16 lockPeriod)
        external
        nonReentrant
    {
        require(stakingEnabled, "Staking is currently disabled");
        require(amount > 49e18, "Min stake 50 MTO");
        require(maxSlots[lockPeriod] != 0, "Invalid lock period");
        require(
            stakedCounts[lockPeriod] < maxSlots[lockPeriod],
            "Staking limit reached"
        );
        require(balanceOf(msg.sender) > amount, "Low balance");

        uint256 currentTime = block.timestamp;
        uint256 unlockTime = currentTime + (lockPeriod * 1 days);
        uint256 reward = (amount * rewardRates[lockPeriod]) / 10000; // Adjusted for decimal percentage

        address contractAddress = address(this);
        _transfer(msg.sender, contractAddress, amount);

        stakes[msg.sender].push(
            Stake({
                amount: amount,
                startTime: currentTime,
                unlockTime: unlockTime,
                reward: reward,
                unstaked: false
            })
        );

        totalStaked = totalStaked + amount;
        stakedCounts[lockPeriod]++;

        emit Staked(msg.sender, amount, unlockTime, reward);
    }

    // Unstake tokens after the lock period has passed.

    function unstake(uint256 stakeIndex) external nonReentrant onlyApproval {
        require(stakeIndex < stakes[msg.sender].length, "Invalid index");

        Stake storage userStake = stakes[msg.sender][stakeIndex];
        require(userStake.amount != 0, "No stake");
        require(block.timestamp > userStake.unlockTime, "Locked");
        require(!userStake.unstaked, "Already unstaked");

        totalStaked = totalStaked - userStake.amount;
        totalStaked = totalStaked - userStake.amount;

        uint256 lockPeriod = (userStake.unlockTime - userStake.startTime) /
            1 days;
        if (stakedCounts[lockPeriod] >= 1) {
            unchecked {
                stakedCounts[lockPeriod]--;
            }
        }

        _transfer(
            address(this),
            msg.sender,
            userStake.amount + userStake.reward
        );

        emit Unstaked(msg.sender, userStake.amount, userStake.reward);
    }

    // =======================
    // Getter Functions
    // =======================

    // Get all stakes for a specific user.
    function getUserStakes(address user)
        external
        view
        returns (Stake[] memory)
    {
        return stakes[user];
    }

    // View stakes for the sender.
    function viewMyStakes() external view returns (Stake[] memory) {
        return stakes[msg.sender];
    }

    // Get the total staked amount.
    function totalStakedAmount() external view returns (uint256) {
        return totalStaked;
    }

    // Get the current staked counts for fixed lock periods.
    function getStakedCounts()
        external
        view
        returns (uint256[5] memory counts)
    {
        counts[0] = stakedCounts[45];
        counts[1] = stakedCounts[90];
        counts[2] = stakedCounts[180];
        counts[3] = stakedCounts[270];
        counts[4] = stakedCounts[365];
    }

    // Get the maximum slots available for fixed lock periods.
    function getMaxSlots() external view returns (uint256[5] memory slots) {
        slots[0] = maxSlots[45];
        slots[1] = maxSlots[90];
        slots[2] = maxSlots[180];
        slots[3] = maxSlots[270];
        slots[4] = maxSlots[365];
    }

    // Get the reward rates for fixed lock periods.
    function getRewardRates() external view returns (uint256[5] memory rates) {
        rates[0] = rewardRates[45];
        rates[1] = rewardRates[90];
        rates[2] = rewardRates[180];
        rates[3] = rewardRates[270];
        rates[4] = rewardRates[365];
    }
}

